INSERT INTO `tbl_rejected` (`id_rejected`, `alasan`, `revisi`, `upi_id`) VALUES
(4, 'belum memenuhi syarat', NULL, 66),
(8, 'Mohon maaf apabila anda ingin membuat SKP harap mengisi data dengan benar. Sertakan dokumen seperti izin usaha perikanan, identitas pemohon, surat pernyataan melakukan proses produksi secara aktif, bukti kepemilikan tempat produksi, manual GMP-SSOP. Agar kami bisa mendata UPI anda terima kasih.', NULL, 150),
(9, 'Mohon maaf perusahaan anda bukan berada di area Provinsi Jawa Barat melainkan Provinsi Banten. Untuk itu silahkan mendaftarkan perusahaan anda ke Provinsi Banten. ', NULL, 151),
(10, 'UPI anda sudah terdaftar di aplikasi ini sebelumnya, dimohon agar menggunakan 1 akun saja agar mempermudah kami dalam memproses SKP kedepannya. Terima kasih', NULL, 152),
(12, 'perbaiki nilai omzet tahunan UPI', 'Mohon input data baru. Thanks', 178);
